import React from "react";
import useStats from "../lib/useStats";

const StateBlock = ({ url }, props) => {
  const { stats, loading, error } = useStats(url);
  console.log(stats);

  return (
    <div
      style={{
        width: "40vw",
        height: "30vh",

        outline: "1px solid black",
      }}
    >
      {stats.map(state => (
        <p>{state.provinceState}</p>
      ))}
    </div>
  );
};

export default StateBlock;
